import logo from './logo.svg';
import './App.css';
import useMoEngage from './hooks/useMoengage';
import useNotifications from './hooks/useNotifications'
import { useEffect } from 'react';

function App() {
  const tracker = useMoEngage();
  const enablePushNotifications = useNotifications('ruchi123');

  useEffect(() => {
    enablePushNotifications()
  }, [])

  return (
    <div className="App">
      <header className="App-header">
        {/* <img src={logo} className="App-logo" alt="logo" /> */}
        <h1>Welcome to My React Home Page</h1>
        <p>This is a simple home page built with React.</p>

        <div>
        <button style={{padding: '1rem', color: 'white', background:'#3c72c9', border: 'none', margin: '0 1rem', width: '9rem', fontWight: 'bold'}} onClick={() => tracker('NOTIFIED')}>Get Notification</button>
        <button  style={{padding: '1rem', color: 'white', background:'#3c72c9', border: 'none', width: '9rem'}} onClick={() => tracker('Button-one')}>Button 2</button>
        <button  style={{padding: '1rem', color: 'white', background:'#3c72c9', border: 'none', margin: '0 1rem', width: '9rem'}} onClick={() => tracker('Button-two')}>Button 3</button>
        </div>
      <div className="home-page">
    </div>
      </header>
    </div>
  );
}

export default App;
